import React from 'react';

const AboutUs = () => {
    return (
        <div className="container">
            <h1>About Us</h1>
            <p>
                Welcome to SendTextAnywhere! We are dedicated to providing seamless communication
                solutions that connect you with your loved ones, colleagues, and clients wherever 
                they are. Our mission is to make texting easy, efficient, and accessible to everyone.
            </p>
            <div className="profile">
                <img src="./developer-photo.jpg" alt="Developer Name" className="profile-photo" />
                <div className="profile-info">
                    <h2>Developer Name</h2>
                    <p>
                        Hi! I'm the developer behind SendTextAnywhere. My passion is to create user-friendly
                        applications that make communication easier for everyone. I am constantly working
                        to enhance this platform and improve your experience. Thank you for being part of our journey!
                    </p>
                </div>
            </div>
        </div>
    );
};

export default AboutUs;
